import React from 'react';
import './App.css';
import './styles.css';
import Counter from './components/Counter';
import CounterSS from './components/CounterSS';
import Monitor from './components/Monitor';


function App() {
  return (
    <div className="main-app-container">
      <div style={{ width: '60%', display: 'flex', justifyContent: 'flex-start' }}><hr className="main-separator" /></div>
      <div className="main-component-section">
         <h1 className="main-component-title">Counter with String</h1>
        <Counter />
      </div>
      <div style={{ width: '60%', display: 'flex', justifyContent: 'flex-start' }}><hr className="main-separator" /></div>
          <div className="main-component-section">
        <h1 className="main-component-title">Counter with Sorted Set</h1>
        <CounterSS />
      </div>

      <div style={{  position: 'sticky', width: '60%', display: 'flex', justifyContent: 'flex-start' }}><hr className="main-separator" /></div>
      <div className="main-component-section">
        <h1 className="main-component-title">Monitor</h1>
        <Monitor />
      </div>

    </div>
  );
}

export default App;
